var geocoder;if(navigator.geolocation){navigator.geolocation.getCurrentPosition(successFunction,errorFunction)}function successFunction(a){var c=a.coords.latitude;var b=a.coords.longitude;codeLatLng(c,b)}function errorFunction(){alert("Geocoder falhou")}function initialize(){geocoder=new google.maps.Geocoder()}function codeLatLng(b,a){var c=new google.maps.LatLng(b,a);geocoder.geocode({latLng:c},function(g,e){if(e==google.maps.GeocoderStatus.OK){console.log(g);if(g[1]){alert(g[0].formatted_address);for(var f=0;f<g[0].address_components.length;f++){for(var d=0;d<g[0].address_components[f].types.length;d++){if(g[0].address_components[f].types[d]=="administrative_area_level_1"){city=g[0].address_components[f];break}}}alert(city.short_name+" "+city.long_name)}else{alert("Nenhum Resultado Encontrado")}}else{alert("Geocoder falhou em tentar: "+e)}})};